import React, { useState, useEffect } from 'react';
import './App.css';
import { Clock } from 'lucide-react';

const GRID_WIDTH = 10;
const GRID_HEIGHT = 10;
const BOX_SIZE = 50;
const EMOJI_SIZE = 30;

export default function App() {
  const [gameState, setGameState] = useState({
    beast: [0, 0],
    engineers: [],
    walls: []
  });

  const [elapsedTime, setElapsedTime] = useState(0);

  useEffect(() => {
    // ... (keep the existing useEffect logic)
  }, []);

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  };

  return (
    <div className="flex flex-col items-start min-h-screen bg-gray-900 text-white p-4">
      <h1 className="text-4xl font-bold mb-4">Beast Hunt Game</h1>

      <div className="flex flex-row w-full space-x-4">
        {/* Game Info Table */}
        <div className="game-info w-64 flex-shrink-0">
          <div className="mb-2 flex items-center">
            <Clock className="mr-2" size={16} />
            <span className="text-lg">{formatTime(elapsedTime)}</span>
          </div>
          <table className="table-auto border-collapse w-full text-sm">
            <thead>
              <tr>
                <th className="px-2 py-1 text-left">ENTITY</th>
                <th className="px-2 py-1 text-left">POSITION</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="border px-2 py-1">ðŸ‘¹ Beast</td>
                <td className="border px-2 py-1">
                  ({gameState.beast[0]}, {gameState.beast[1]})
                </td>
              </tr>
              {gameState.engineers.map((engineer, index) => (
                <tr key={index}>
                  <td className="border px-2 py-1">
                    {engineer.emoji} {engineer.name}
                  </td>
                  <td className="border px-2 py-1">
                    ({engineer.position[0]}, {engineer.position[1]})
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Game Board */}
        <div className="game-board-container flex-grow">
          <div
            className="game-board"
            style={{
              display: 'grid',
              gridTemplateColumns: `repeat(${GRID_WIDTH}, ${BOX_SIZE}px)`,
              gridTemplateRows: `repeat(${GRID_HEIGHT}, ${BOX_SIZE}px)`,
              gap: '1px',
              padding: '10px',
              borderRadius: '8px',
              backgroundColor: '#2d3748',
            }}
          >
            {Array.from({ length: GRID_WIDTH * GRID_HEIGHT }).map((_, index) => {
              const x = index % GRID_WIDTH;
              const y = Math.floor(index / GRID_WIDTH);
              let content = '';
              let bgColor = '#4a5568';
              let name = '';

              if (gameState.beast[0] === x && gameState.beast[1] === y) {
                content = 'ðŸ‘¹';
                name = 'Beast';
              } else {
                const engineer = gameState.engineers.find(
                  (eng) => eng.position[0] === x && eng.position[1] === y
                );
                if (engineer) {
                  content = engineer.emoji;
                  name = engineer.name;
                }
              }

              return (
                <div
                  key={index}
                  style={{
                    width: BOX_SIZE,
                    height: BOX_SIZE,
                    backgroundColor: bgColor,
                    display: 'flex',
                    flexDirection: 'column',
                    justifyContent: 'center',
                    alignItems: 'center',
                    fontSize: `${EMOJI_SIZE}px`,
                  }}
                >
                  <span>{content}</span>
                  {name && <span style={{ fontSize: '10px' }}>{name}</span>}
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}
